import Vue from 'vue'
import VueRouter from 'vue-router'

Vue.use(VueRouter)

const routes = [
  {
    path: '/home',
    name: 'home',
    component: () => import('../views/project/HomeView.vue')
  },
  {
    path: '/blogHome',
    name: 'blogHome',
    component: () => import('../views/project/BlogHomeView.vue')
  },
  {
    path: '/personal',
    name: 'personal',
    component: () => import('../views/project/PersonalView.vue')
  },
  {
    path: '/administrator',
    name: 'administrator',
    component: () => import('../views/project/AdministratorView.vue')
  },
  {
    path: '/edit',
    name: 'edit',
    component: () => import('../views/project/EditView.vue')
  },
  {
    path: '/about',
    name: 'about',
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () => import(/* webpackChunkName: "about" */ '../views/AboutView.vue')
  },
  {
    path: '/app',
    name: 'app',
    component: () => import('../App.vue')
  }
]

const router = new VueRouter({
  mode: 'history',
  routes
})
export default router
